  true,\n\t\"url\": null,\n\t\"notes\": \"<p>National Database for Autism Research
  (NDAR) is an extensible, scalable informatics platform for austism spectrum disorder-relevant
  data at all levels of biological and behavioral organization (molecules, genes,
  neural tissue, behavioral, social and environmental interactions) and for all data
  types (text, numeric, image, time series, etc.). NDAR was developed to share data
  across the entire ASD field and to facilitate collaboration across laboratories,
  as well as interconnectivity with other informatics platforms.</p>n\",\n\t\"license_title\":
